// Mysterious 'end()' bug -- caused by a lexer bug that interpreted '.e' as a number in scientific notation

test(function () {
  var p = caterwaul.parse;

  eq(p('foo.bar()').inspect(), '(() (. (foo) (bar)) (<>))');
  eq(p('foo.e()').inspect(), '(() (. (foo) (e)) (<>))');
  eq(p('foo.end()').inspect(), '(() (. (foo) (end)) (<>))');
});

